import { Button } from 'antd';
import styled from 'styled-components';


const DetailPost = ({ onClose }) => {
    return (
        <>
        <Button  style={{width: '100%'}} onClick={onClose}>닫기</Button>
        
        </>
        
    );
};

export default DetailPost;
